import kotlin.math.absoluteValue

val inputReal = """"""
//val inputTest = """tvVcCtTEedPpvVDaAtfbBxiIXFMnNEPpei"""
val inputTest = """tvVcCtTEeX"""
val input = inputReal


var minimum = 1000000
fun react(replacedInput: String, char: Char) {

    var input = replacedInput
    var counter = 1
    while (counter < input.length-1) {
        if ((input[counter-1] - input[counter]).absoluteValue == 32) {
            input = "${input.take(counter-1)}${input.substring(counter+1)}"
            counter = 1
        } else {
            counter++
        }
    }

    if (input.length < minimum) {
        minimum = input.length
    }

    println("char replaced: ${(char)}")
    println("currentRegisters length: ${input.length}")
}

for (i in 'a'..'z') {
    var replaced = input.replace(i.toString(), "")
    replaced = replaced.replace((i-32).toString(), "")
    react(replaced, i)
}

println("minimum: $minimum")
